Category: Painted Carpet
Unique, hand woven
Scarf: Wool
Warp: Cotton
Origin: Turkey
116 CM x 205 CM

For a contemporary look with abstract appeal, this blue-colored area rug has been skillfully crafted with a revitalization of a real hand-woven vintage Turkish rug woven in the 60s or 70s. It is made of wool on cotton. The process of creating these works of art begins by cutting the pile to lower it. Then they go through many processes to remove the color. They are now ready to be painted in one color, a stage that can be repeated several times to achieve the desired saturation level, and tones that complement and contrast the old. In addition to being unique and hand-woven, these rugs make a very special statement about how craftsmanship and knowledge bridged between generations over time. This magnificent transformation can be regarded as a contemporary art piece with a unique look that complements any modern decor. #kilim #halı #dekorasyon #evim #evdekorasyon #moderndekor #dekorasyonfikirleri #mobilya #salon #mutfakhalısı #yazlıkhalı #kaymazhalı  #halımodelleri #halıçeşitleri #kilimmodelleri#antiquerugs  #antiquecarpets  #antiquecarpet #carpet #istanbul #beauty #travel #onlineshopping #turkiye #turkey";}i:95;a:1:{s:14:"comments_count";i:0;}i:96;a:1:{s:11:"likes_count";i:1;}i:97;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuj5XKJgbP";}i:98;a:1:{s:5:"image";s:259:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118766126_191792369046185_7216385313197376874_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=nrwCoIzNcfUAX8KrCPt&_nc_tp=15&oh=3c1b19e45fbda72b6e8bf5cb21068123&oe=5F7B27DC";}i:99;a:1:{s:4:"type";s:7:"sidecar";}i:100;a:1:{s:8:"owner_id";i:11572411947;}i:101;a:1:{s:14:"owner_username";s:0:"";}i:102;a:1:{s:14:"owner_fullname";s:0:"";}i:103;a:1:{s:9:"owner_pic";s:0:"";}i:104;a:1:{s:2:"id";s:19:"2391006104081672250";}i:105;a:1:{s:10:"short_code";s:11:"CEuj2IxlCg6";}i:106;a:1:{s:12:"created_time";i:1599250160;}i:107;a:1:{s:7:"caption";s:128:"#bcn#lighting #bcnlighting #avize #aydınlatma #retro #mobilya #mimar #içmimar